import './App.css';
import Header from './Header';
import Home from './Homepage';
import {BrowserRouter,Routes,Route} from "react-router-dom"
import Productdes from './productdes';




function App() {
  return (
    <div >
       <Header/>
      <BrowserRouter>
   <Routes>
    <Route path='/' element={<Home/>}/>
    <Route path='pd' element={<Productdes/>}/>
   </Routes>

    </BrowserRouter>
    </div>
  );
}

export default App;
